import React, { useState } from "react"
import "./index.css"

const App=()=>{
   [listval, listUpval]=useState("");
   thisVal=(obj)=>{
    listUpval(obj.target.value);
  }
  return(
    <>
    <div className="center">
      <div className="cen">
       <h1 className="back">My Todo Listy</h1>
       <span>
       <input type="text" placeholder="Enter list of Tasks" onChange={thisVal}/>
       <button>+</button>
       </span>
       <ol>
         <li>{listval}</li>
       </ol>
      </div>
    </div>
    </>
  )
}
export default App;
